import React from 'react';
import './Contact.scss';

const Contact = () => {
  return (
    <div className='contact-container'>
      <div className="title">Contact Details</div>
      <div className="details">
        <p className='name'>HIMA MADHU</p>
        <div className="phone-section">
          <p className="phone"><strong>UAE:</strong> +971 558653293</p>
          <p className="phone"><strong>IND:</strong> +91 9497638117</p>
          <p className="phone"><strong>WhatsApp:</strong> +91 9497638117</p>
        </div>
        <p className='email'><strong>Email:</strong> himamadhu0409@gmail.com</p>
        <p className='linkedIn'><strong>LinkedIn:</strong> <a href="https://www.linkedin.com/in/hima-madhu-89ba3b236/" target="_blank" rel="noopener noreferrer">Profile</a></p>
        <div className="address-section">
          <p className='address'><strong>Current Address:</strong> E3, Asteco Building, Al-Mutheena St, Deira, Dubai, Postal Code: 1714</p>
          <p className='address'><strong>Permanent Address:</strong> Manapurathu, Peringara P.O, Thiruvalla, Kerala, India, Pincode: 689108</p>
        </div>
      </div>
    </div>
  );
};

export default Contact;
